import React from 'react';
import { Link } from 'react-router-dom';
const Home = (()=>{

    return (
        <>
        <div className="home">
            <h1 className="heading">React Libraray</h1>
            <Button className='but'><Link to="/books"><Book/></Link></Button>
            <Button className='but'><Link to ="/add"><AddIcon/></Link></Button>
            <Button className='but'><Link to ="/update"><Update/></Link></Button>
            </div>
        </>
    )
})
export default Home
